import React from "react";

function Home() {
  return (
    <div>
      <h1 className="h3 mb-3">Blank Page</h1>

      <div className="row">
        <div className="col-12">
          <div className="card">
            <div className="card-header">
              <h5 className="card-title mb-0">Empty card</h5>
            </div>
            <div className="card-body"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
